import { Container, Box} from '@mui/system'
import { useState } from 'react';
import { useNavigate, Link, Outlet } from 'react-router-dom';
import { AppBar, Button, IconButton, Toolbar,Typography, TextField} from '@mui/material';


function MainPage() {

  const navigate = useNavigate();
  const handleSubmit = async (e) => {
    e.preventDefault();
    //const obj = { UserName: userLogin.UserName, password: userLogin.password}
    navigate(`/`);
  }



  return (
    <Container>

      <AppBar position="static" color='default'>
        <Toolbar>

          <IconButton size="small" edge="start" color="inherit" aria-label="menu" sx={{ mr: 70 }} disabled >
            <h5>Movies-Subscriptions Web Site</h5>
          </IconButton>
          <Button sx={{padding: 1, marginTop: 1}} variant="outlined" size="small" type='submit' color="primary" onClick={handleSubmit}>Log Out</Button>
        </Toolbar>
        <Typography variant="h6" component="div" sx={{ flexGrow: 0.1, borderColor: 'divider' }}>
            <Button><Link to={`/movies`}>Movies</Link></Button>
            <Button><Link to={`/subscriptions`}>Subscriptions</Link></Button>
            <Button><Link to={`/usersManagement`}>Users Management</Link></Button>
          </Typography>

      </AppBar>


    <Outlet/>
    </Container>
  );
}

export default MainPage;
